const messages= userData.messages;
const history = useHistory();
let displayMessages= false;

console.log('message', messages[0].content)



    return (
        <>
        <div>
        {userData.username && <div>Hello, {userData.username}!</div>}
        </div>
        <aside>
        <button
        onClick= {() =>{
            history.push('/newPost')
        }}
        >Create New Listing</button>
        <button
        onClick= {() =>{
            displayMessages= true;
            // history.push('/dashboard/messages')
        }}
        >Inbox</button>
        </aside>

        {displayMessages && messages.length> 0 ? 
        (messages.map((message)=>{
            <div key= {message._id} className='messagesDisplay'>
            <h2>From: {message.fromUser.username}</h2>
            <div>Message: {message.content}</div>
        </div>
        })) : 'no messages'
        }
        </>
    )

}

export default Profile;
